<type>file</type>
<content>1: terraform {
2:   required_providers {
3:     aws = {
4:       source  = "hashicorp/aws"
5:       version = "~> 5.0"
6:     }
7:   }
8: }
9: 
10: provider "aws" {
11:   region = var.aws_region
12: }
13: 
14: # VPC
15: resource "aws_vpc" "main" {
16:   cidr_block           = var.vpc_cidr
17:   enable_dns_hostnames = true
18:   enable_dns_support   = true
19: 
20:   tags = {
21:     Environment = var.environment
22:     Project     = var.project_name
23:     ManagedBy   = "terraform"
24:   }
25: }
26: 
27: # Internet Gateway
28: resource "aws_internet_gateway" "igw" {
29:   vpc_id = aws_vpc.main.id
30: 
31:   tags = {
32:     Environment = var.environment
33:     Project     = var.project_name
34:     ManagedBy   = "terraform"
35:   }
36: }
37: 
38: # Public Subnets
39: resource "aws_subnet" "public" {
40:   count                   = var.public_subnet_count
41:   vpc_id                  = aws_vpc.main.id
42:   cidr_block              = var.public_subnet_cidrs[count.index]
43:   availability_zone       = var.public_subnet_azs[count.index]
44:   map_public_ip_on_launch = true
45: 
46:   tags = {
47:     Environment = var.environment
48:     Project     = var.project_name
49:     ManagedBy   = "terraform"
50:     SubnetType  = "public"
51:   }
52: }
53: 
54: # Private Subnets
55: resource "aws_subnet" "private" {
56:   count             = var.private_subnet_count
57:   vpc_id            = aws_vpc.main.id
58:   cidr_block        = var.private_subnet_cidrs[count.index]
59:   availability_zone = var.private_subnet_azs[count.index]
60: 
61:   tags = {
62:     Environment = var.environment
63:     Project     = var.project_name
64:     ManagedBy   = "terraform"
65:     SubnetType  = "private"
66:   }
67: }
68: 
69: # NAT Gateway
70: resource "aws_nat_gateway" "nat" {
71:   allocation_id = aws_eip.nat.id
72:   subnet_id     = aws_subnet.public[0].id
73: 
74:   tags = {
75:     Environment = var.environment
76:     Project     = var.project_name
77:     ManagedBy   = "terraform"
78:   }
79: 
80:   depends_on = [aws_internet_gateway.igw]
81: }
82: 
83: # Elastic IP for NAT Gateway
84: resource "aws_eip" "nat" {
85:   domain = "vpc"
86: 
87:   tags = {
88:     Environment = var.environment
89:     Project     = var.project_name
90:     ManagedBy   = "terraform"
91:   }
92: }
93: 
94: # Route Table for Public Subnets
95: resource "aws_route_table" "public" {
96:   vpc_id = aws_vpc.main.id
97: 
98:   route {
99:     cidr_block = "0.0.0.0/0"
100:     gateway_id = aws_internet_gateway.igw.id
101:   }
102: 
103:   tags = {
104:     Environment = var.environment
105:     Project     = var.project_name
106:     ManagedBy   = "terraform"
107:   }
108: }
109: 
110: # Route Table Association for Public Subnets
111: resource "aws_route_table_association" "public" {
112:   count          = var.public_subnet_count
113:   subnet_id      = aws_subnet.public[count.index].id
114:   route_table_id = aws_route_table.public.id
115: }
116: 
117: # Route Table for Private Subnets
118: resource "aws_route_table" "private" {
119:   vpc_id = aws_vpc.main.id
120: 
121:   route {
122:     cidr_block     = "0.0.0.0/0"
123:     nat_gateway_id = aws_nat_gateway.nat.id
124:   }
125: 
126:   tags = {
127:     Environment = var.environment
128:     Project     = var.project_name
129:     ManagedBy   = "terraform"
130:   }
131: }
132: 
133: # Route Table Association for Private Subnets
134: resource "aws_route_table_association" "private" {
135:   count          = var.private_subnet_count
136:   subnet_id      = aws_subnet.private[count.index].id
137:   route_table_id = aws_route_table.private.id
138: }
139: 
140: # Security Group
141: resource "aws_security_group" "web" {
142:   name        = "${var.project_name}-web"
143:   description = "Allow SSH and HTTP traffic"
144:   vpc_id      = aws_vpc.main.id
145: 
146:   ingress {
147:     from_port   = 22
148:     to_port     = 22
149:     protocol    = "tcp"
150:     cidr_blocks = [var.ssh_cidr]
151:   }
152: 
153:   ingress {
154:     from_port   = 80
155:     to_port     = 80
156:     protocol    = "tcp"
157:     cidr_blocks = ["0.0.0.0/0"]
158:   }
159: 
160:   egress {
161:     from_port   = 0
162:     to_port     = 0
163:     protocol    = "-1"
164:     cidr_blocks = ["0.0.0.0/0"]
165:   }
166: 
167:   tags = {
168:     Environment = var.environment
169:     Project     = var.project_name
170:     ManagedBy   = "terraform"
171:   }
172: }
173: 
174: # AWS AMI Data Source for Amazon Linux 2023
175: data "aws_ami" "amazon_linux_2023" {
176:   most_recent = true
177:   owners      = ["amazon"]
178: 
179:   filter {
180:     name   = "name"
181:     values = ["al2023-ami-2023.*-x86_64"]
182:   }
183: 
184:   filter {
185:     name   = "virtualization-type"
186:     values = ["hvm"]
187:   }
188: }
189: 
190: # EC2 Instance in Public Subnet
191: resource "aws_instance" "web" {
192:   ami                    = data.aws_ami.amazon_linux_2023.id
193:   instance_type          = var.instance_type
194:   subnet_id              = aws_subnet.public[0].id
195:   vpc_security_group_ids = [aws_security_group.web.id]
196:   key_name               = var.key_name
197: 
198:   tags = {
199:     Environment = var.environment
200:     Project     = var.project_name
201:     ManagedBy   = "terraform"
202:   }
203: }
204: 
205: # Output
206: output "vpc_id" {
207:   description = "ID of the VPC"
208:   value       = aws_vpc.main.id
209: }
210: 
211: output "public_subnet_ids" {
212:   description = "IDs of the public subnets"
213:   value       = aws_subnet.public[*].id
214: }
215: 
216: output "ec2_public_ip" {
217:   description = "Public IP address of the EC2 instance"
218:   value       = aws_instance.web.public_ip
219: }
220: 
221: output "ec2_public_dns" {
222:   description = "Public DNS name of the EC2 instance"
223:   value       = aws_instance.web.public_dns
224: }
225: 
226: # Variables
227: variable "aws_region" {
228:   description = "AWS region"
229:   type        = string
230:   default     = "us-east-1"
231: }
232: 
233: variable "vpc_cidr" {
234:   description = "VPC CIDR block"
235:   type        = string
236:   default     = "10.0.0.0/16"
237: }
238: 
239: variable "public_subnet_cidrs" {
240:   description = "CIDR blocks for public subnets"
241:   type        = list(string)
242:   default     = ["10.0.1.0/24", "10.0.2.0/24"]
243: }
244: 
245: variable "private_subnet_cidrs" {
246:   description = "CIDR blocks for private subnets"
247:   type        = list(string)
248:   default     = ["10.0.3.0/24", "10.0.4.0/24"]
249: }
250: 
251: variable "public_subnet_azs" {
252:   description = "Availability zones for public subnets"
253:   type        = list(string)
254:   default     = ["us-east-1a", "us-east-1b"]
255: }
256: 
257: variable "private_subnet_azs" {
258:   description = "Availability zones for private subnets"
259:   type        = list(string)
260:   default     = ["us-east-1a", "us-east-1b"]
261: }
262: 
263: variable "public_subnet_count" {
264:   description = "Number of public subnets"
265:   type        = number
266:   default     = 2
267: }
268: 
269: variable "private_subnet_count" {
270:   description = "Number of private subnets"
271:   type        = number
272:   default     = 2
273: }
274: 
275: variable "instance_type" {
276:   description = "EC2 instance type"
277:   type        = string
278:   default     = "t3.micro"
279: }
280: 
281: variable "ssh_cidr" {
282:   description = "CIDR block for SSH access"
283:   type        = string
284:   default     = "0.0.0.0/0"
285: }
286: 
287: variable "key_name" {
288:   description = "Name of the EC2 key pair"
289:   type        = string
290: }
